import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body.css';
import {
    BrowserRouter as Router,
    Route, Link
  } from "react-router-dom";
import Bodybottom from './Body-bottom';
import Bodynavbar from './Body-navbar';
class Body extends Component {
  render(){
  return (
    <Router>
      <div className="body">
        {/* <Bodybottom></Bodybottom> */}
        <Bodynavbar></Bodynavbar>
      </div>
</Router>
    
  );
}}

export default Body;
